import React, { Component } from 'react'
import PropTypes from 'prop-types'

class Graph extends Component {
    render() {
        const stock = this.props.stock;

        return (
            <div>

            {stock.graph.map((data) => (
                <tr>
                    <td> {data[0]} </td>
                    <td> {data[1]} </td>
                    </tr>
            ) )

             }

            </div>


        )

    }
}

//Graph.PropTypes = {
  //  data: PropTypes.array.isRequired
//}
export default Graph;
